pragma solidity ^0.4.24;

contract Vote {

    // Restaurant Object
    struct Restaurant {
        uint id;
        string name;
        uint voteCount;
    }

    // Store Data


    // Fetch Data
    mapping(uint => Restaurant) public restaurant;

    // Number of restaurant
    uint public restaurantCount;


    function VoteFunc () public{
        addRestaurant("Restaurant 1");
        addRestaurant("Restaurant 2");
        addRestaurant("Restaurant 3");
        addRestaurant("Restaurant 4");
        addRestaurant("Restaurant 5");

    }

    function addRestaurant (string memory _name) private {
        restaurantCount++;
        restaurant[restaurantCount] = Restaurant(restaurantCount, _name, 0);
    }
}
